<html>
    <head>
        <link rel="stylesheet" type="text/css" href="css/lightbox.min.css">
        <script type="text/javascript" src="js/lightbox-plus-jquery.min.js"></script>
        <style>
            *
            {
                margin: 0px;
                padding: 0px;
            }
            body{
                
                background-attachment:fixed;
            }
            header
            {
                height: 24%;
                width:100%;
                background-color:darkblue;
                background-attachment: fixed;
            }
            #logo{
                position: absolute;
                top:7%;
                left:50%;
                transform: translate(-50%,-50%);
            }
            #login{
                position: absolute;
                top: 5%;
                right:2%;
                background-color: tomato;
                transform: translate(-50%,-50%);
                border-radius: 20px;
                height: 30px;
                width: 180px;
                text-align: center;
                color: white;
                
            }
            #home{
              position: absolute;
                top: 5%;
                left:15%;
                background-color: tomato;
                transform: translate(-50%,-50%);
                border-radius: 20px;
                height: 30px;
                width: 180px;
                text-align: center;
                color: white;  
            }
            #login a,#home a{
                text-decoration: none;
                color: white; 
                display: inline-block;
                top: 5px;
                position:relative;
            }
            #text{
                top:20%;
                left:50%;
                position: absolute;
                transform: translate(-50%,-50%);
                color: White;
                height:50px;
                width: 500px;
                text-align: center;
                background-color: crimson;
                border-radius: 50px;
                padding: 15px;
                font-family: "bookman old style";
                font-size: 50px;
            }
            .gallery{
                top:72%;
                left:51%;
                height:90%;
                width: 89%;
                position: absolute;
                transform: translate(-50%,-50%);
                
            }
            .gallery img{
                width:250px;
                height:200px;
                padding:20px;
                border-radius: 50px;
                transition: 1s;
            }
            .gallery img:hover{
                transform: scale(1.1);
            }
            #myVideo {
                position: fixed;
                right: 0;
                bottom: 0;
                min-width: 100%; 
                min-height: 100%;
            }
        </style>
    </head>
